import { useState } from 'react';
function Car(props){
    const myVals = props.data;
    const [final, setFinal] = useState([]);
    console.log(myVals);
    for(let i = 0; i < myVals.length; i++){
        if(myVals[i].Variable=== 'Make'){
            let newVal = (myVals[i].Value).toString();
            setFinal([...final,newVal]);
            console.log(final.length);
        }
        else if(myVals[i].Variable=== 'Model')
        {
            let newVal = (myVals[i].Value).toString();
            setFinal([...final,newVal]);
        }
    }
    return(
        <p>
            Make is {final[0]} and Model is {final[1]}
        </p>
    )

}
export default Car;
